INSERT INTO `questionnaires` VALUES (1,'{\"ro\":\"Roata Profilului afectiv binar\",\"en\":\"Binary Affective Profile Wheel\"}','{\"ro\":\"In roata de mai jos veti gasi un numar de cuvinte si expresii care descriu diferite emotii si trairi. Cititi fiecare item si apoi marcati rÄƒspunsul adecvat.\",\"en\":\"In roata de mai jos veti gasi un numar de cuvinte si expresii care descriu diferite emotii si trairi. Cititi fiecare item si apoi marcati rÄƒspunsul adecvat.\"}',0,'radial','normal'),(2,'{\"ro\":\"Chestionar coaching subordonati\",\"en\":\"Chestionar coaching subordonati\"}','{\"ro\":\"Cititi cu atentie afirmatiile de mai jos si apreciati cat de bine descrie fiecare dintre aceste afirmatii comportamentele superiorului dvs. fata de dvs.\",\"en\":\"Cititi cu atentie afirmatiile de mai jos si apreciati cat de bine descrie fiecare dintre aceste afirmatii comportamentele superiorului dvs. fata de dvs.\"}',0,'normal','normal'),(3,'{\"ro\":\"Grila de evaluare observationala a abilitatilor de coaching\",\"en\":\"Grila de evaluare observationala a abilitatilor de coaching\"}','{\"ro\":\"descrere\",\"en\":\"description\"}',0,'normal','normal'),(4,'{\"ro\":\"M-RIBS angajati - sectiunea 1\",\"en\":\"M-RIBS angajati - section 1\"}','{\"ro\":\"Va rugam sa va ganditi la o situatie la serviciu in care munca dvs. nu a fost apreciata corect, nu a fost recunoscuta sau rasplatita pe masura. Incercati sa va amintiti gandurile pe care le-ati avut intr-o asemenea situatie si apreciati cat de mult reprezinta afirmatiile de mai jos gandurile pe care le-ati avut. \",\"en\":\"Va rugam sa va ganditi la o situatie la serviciu in care munca dvs. nu a fost apreciata corect, nu a fost recunoscuta sau rasplatita pe masura. Incercati sa va amintiti gandurile pe care le-ati avut intr-o asemenea situatie si apreciati cat de mult reprezinta afirmatiile de mai jos gandurile pe care le-ati avut.\"}',10,'normal','normal'),(5,'{\"ro\":\"M-RIBS angajati - sectiunea 2\",\"en\":\"M-RIBS angajati - section 2\"}','{\"ro\":\"Va rugam sa va ganditi la o situatie la serviciu cand ati avut rezultate slabe dvs. sau colegii/ echipa din care faceti parte. Incercati sa va amintiti gandurile pe care le-ati avut intr-o asemenea situatie si apreciati cat de mult reprezinta afirmatiile de mai jos gandurile pe care le-ati avut.\",\"en\":\"Va rugam sa va ganditi la o situatie la serviciu cand ati avut rezultate slabe dvs. sau colegii/ echipa din care faceti parte. Incercati sa va amintiti gandurile pe care le-ati avut intr-o asemenea situatie si apreciati cat de mult reprezinta afirmatiile de mai jos gandurile pe care le-ati avut.\"}',10,'normal','normal'),(6,'{\"ro\":\"M-RIBS angajati - sectiunea 3\",\"en\":\"M-RIBS angajati - section 3\"}','{\"ro\":\"Va rugam sa va ganditi la o situatie la serviciu in care v-ati simtit inconfortabil, stresati sau a trebui sa realizati activitati care nu va plac. Incercati sa va amintiti gandurile pe care le-ati avut intr-o asemenea situatie si apreciati cat de mult reprezinta afirmatiile de mai jos gandurile pe care le-ati avut.\",\"en\":\"Va rugam sa va ganditi la o situatie la serviciu in care v-ati simtit inconfortabil, stresati sau a trebui sa realizati activitati care nu va plac. Incercati sa va amintiti gandurile pe care le-ati avut intr-o asemenea situatie si apreciati cat de mult reprezinta afirmatiile de mai jos gandurile pe care le-ati avut.\"}',10,'normal','normal'),(7,'{\"ro\":\"M-RIBS manageri - sectiunea 1\",\"en\":\"M-RIBS managers - section 1\"}','{\"ro\":\"Va rugam sa va ganditi la o situatie la serviciu in care performanta dvs. nu a fost atat de buna precum va asteptati sau in care aceasta nu a fost apreciata. Incercati sa va amintiti gandurile pe care le-ati avut intr-o asemenea situatie si apreciati cat de mult reprezinta afirmatiile de mai jos gandurile pe care le-ati avut.\",\"en\":\"Va rugam sa va ganditi la o situatie la serviciu in care performanta dvs. nu a fost atat de buna precum va asteptati sau in care aceasta nu a fost apreciata. Incercati sa va amintiti gandurile pe care le-ati avut intr-o asemenea situatie si apreciati cat de mult reprezinta afirmatiile de mai jos gandurile pe care le-ati avut.\"}',10,'normal','normal'),(8,'{\"ro\":\"M-RIBS manageri - sectiunea 2\",\"en\":\"M-RIBS managers - section 2\"}','{\"ro\":\"Va rugam sa va ganditi la o situatie la serviciu in care performanta dvs. nu a fost atat de buna precum va asteptati sau in care aceasta nu a fost apreciata. Incercati sa va amintiti gandurile pe care le-ati avut intr-o asemenea situatie si apreciati cat de mult reprezinta afirmatiile de mai jos gandurile pe care le-ati avut.\",\"en\":\"Va rugam sa va ganditi la o situatie la serviciu in care performanta dvs. nu a fost atat de buna precum va asteptati sau in care aceasta nu a fost apreciata. Incercati sa va amintiti gandurile pe care le-ati avut intr-o asemenea situatie si apreciati cat de mult reprezinta afirmatiile de mai jos gandurile pe care le-ati avut.\"}',10,'normal','normal'),(9,'{\"ro\":\"M-RIBS manageri - sectiunea 3\",\"en\":\"M-RIBS managers - section 3\"}','{\"ro\":\"Va rugam sa va ganditi la o situatie la serviciu in care v-ati simtit stresati. Incercati sa va amintiti gandurile pe care le-ati avut intr-o asemenea situatie si apreciati cat de mult reprezinta afirmatiile de mai jos gandurile pe care le-ati avut.\",\"en\":\"Va rugam sa va ganditi la o situatie la serviciu in care v-ati simtit stresati. Incercati sa va amintiti gandurile pe care le-ati avut intr-o asemenea situatie si apreciati cat de mult reprezinta afirmatiile de mai jos gandurile pe care le-ati avut.\"}',10,'normal','normal'),(10,'{\"ro\":\"Informatii personale\",\"en\":\"Personal information\"}','{\"ro\":\"descriere\",\"en\":\"description\"}',0,'normal','normal'),(11,'{\"ro\":\"Profilul Distresului Afectiv \",\"en\":\"Profilul Distresului Afectiv \"}','{\"ro\":\"Mai jos va prezentam o lista de cuvinte care descriu emotiile pe care oamenii le au in diverse situatii. Cititi cu atentie fiecare cuvant, apoi marcati prin colorarea cerculetului corespunzator varianta care corespunde cel mai bine intrebarii: CUM V-ATI SIMTIT IN ULTIMELE  DOUA SAPTAMANI?\",\"en\":\"Mai jos va prezentam o lista de cuvinte care descriu emotiile pe care oamenii le au in diverse situatii. Cititi cu atentie fiecare cuvant, apoi marcati prin colorarea cerculetului corespunzator varianta care corespunde cel mai bine intrebarii: CUM V-ATI SIMTIT IN ULTIMELE  DOUA SAPTAMANI?\"}',10,'normal','normal'),(12,'{\"ro\":\"tester\",\"en\":\"tester\"}','{\"ro\":\"vvvvv\",\"en\":\"vvvvv\"}',2,'normal','360');
