fi participarea lor la sedintele departamentale, delegarea unui mentor sau altele similare.\"}','choice'),(42,2,'{\"ro\":\"ÃŽsi comunica expectantele legate de performanta pe care o asteapta de la subordonati si de modul de finalizare a sarcinilor date.\",\"en\":\"ÃŽsi comunica expectantele legate de performanta pe care o asteapta de la subordonati si de modul de finalizare a sarcinilor date.\"}','choice'),(43,2,'{\"ro\":\"Stabileste pentru angajati obiective clare legate de sarcini si performanta.\",\"en\":\"Stabileste pentru angajati obiective clare legate de sarcini si performanta.\"}','choice'),(44,2,'{\"ro\":\"Priveste lucrurile si din perspectiva altor persoane, inclusiv cea a subordonatului.\",\"en\":\"Priveste lucrurile si din perspectiva altor persoane, inclusiv cea a subordonatului.\"}','choice'),(45,2,'{\"ro\":\"ÃŽncurajeaza subordonatii sa adopte perspective diferite asupra sarcinilor sau problemelor.\",\"en\":\"ÃŽncurajeaza subordonatii sa adopte perspective diferite asupra sarcinilor sau problemelor.\"}','choice'),(46,2,'{\"ro\":\"Foloseste analogii, scenarii, metafore si exemple pentru a facilita gasirea solutiilor la probleme.\",\"en\":\"Foloseste analogii, scenarii, metafore si exemple pentru a facilita gasirea solutiilor la probleme.\"}','choice'),(47,2,'{\"ro\":\"Aduce persoane din exterior care sa faciliteze invatarea, atunci cand a epuizat toate celelalte solutii.\",\"en\":\"Aduce persoane din exterior care sa faciliteze invatarea, atunci cand a epuizat toate celelalte solutii.\"}','choice'),(50,3,'{\"ro\":\"Comunicarea obiectivelor\",\"en\":\"Comunicarea obiectivelor\"}','choice'),(51,3,'{\"ro\":\"Intrebari de ghidare\",\"en\":\"Intrebari de ghidare\"}','choice'),(52,3,'{\"ro\":\"Sumarizare\",\"en\":\"Sumarizare\"}','choice'),(53,3,'{\"ro\":\"Feedback pozitiv\",\"en\":\"Feedback pozitiv\"}','choice'),(54,3,'{\"ro\":\"Feedback negativ constructiv\",\"en\":\"Feedback negativ constructiv\"}','choice'),(55,3,'{\"ro\":\"Perspective diferite\",\"en\":\"Perspective diferite\"}','choice'),(56,3,'{\"ro\":\"Analogii, scenarii, metafore\",\"en\":\"Analogii, scenarii, metafore\"}','choice'),(57,3,'{\"ro\":\"Ghidarea construirii planului de rezolvare a sarcinii (De ex. Ce te-ai gandit sa faci? Acopera tot ceea ce ti-ai propus tu? Mai sunt alte lucruri de luat in considerare in acest plan?)\",\"en\":\"Ghidarea construirii planului de rezolvare a sarcinii (De ex. Ce te-ai gandit sa faci? Acopera tot ceea ce ti-ai propus tu? Mai sunt alte lucruri de luat in considerare in acest plan?)\"}','choice'),(58,3,'{\"ro\":\"Obstacole viitoare\",\"en\":\"Obstacole viitoare\"}','choice'),(59,3,'{\"ro\":\"Evaluarea subordonatului\",\"en\":\"Evaluarea subordonatului\"}','choice'),(60,3,'{\"ro\":\"Expectante\",\"en\":\"Expectante\"}','choice'),(61,3,'{\"ro\":\"Incercuiti varianta potrivita\",\"en\":\"Incercuiti varianta potrivita\"}','choice'),(62,4,'{\"ro\":\"Trebuie neaparat sa fiu apreciat/a corect si recompensat pentru  eforturile mele in munca pe care o defasor. \",\"en\":\"Trebuie neaparat sa fiu apreciat/a corect si recompensat pentru  eforturile mele in munca pe care o defasor. \"}','choice'),(63,4,'{\"ro\":\"Imi doresc foarte mult sa fiu apreciat/a pentru munca mea, dar realizez si accept ca lucrurile nu trebuie sa fie intotdeauna asa cum vreau eu sa fie. \",\"en\":\"Imi doresc foarte mult sa fiu apreciat/a pentru munca mea, dar realizez si accept ca lucrurile nu trebuie sa fie intotdeauna asa cum vreau eu sa fie. \"}','choice'),(64,4,'{\"ro\":\"Este ingrozitor cand nu sunt apreciat/a pentru eforturi si nu mi se recunosc meritele. \",\"en\":\"Este ingrozitor cand nu sunt apreciat/a pentru eforturi si nu mi se recunosc meritele. \"}','choice'),(65,4,'{\"ro\":\"Daca nu nu sunt apreciat/a la serviciu si recompensat/a pe masura eforturilor, inseamna ca nu sunt bun de nimic.\",\"en\":\"Daca nu nu sunt apreciat/a la serviciu si recompensat/a pe masura eforturilor, inseamna ca nu sunt bun de nimic.\"}','choice'),(66,4,'{\"ro\":\"Este insuportabil si nu pot tolera sa nu fiu apreciat/a si tratat/a corect in munca pe care o desfasor.\",\"en\":\"Este insuportabil si nu pot tolera sa nu fiu apreciat/a si tratat/a corect in munca pe care o desfasor.\"}','choice'),(67,4,'{\"ro\":\"Pot suporta atunci cand nu sunt apreciat/a si recompensat/a pentru munca mea, chiar daca imi este dificil sa tolerez acest lucru. \",\"en\":\"Pot suporta atunci cand nu sunt apreciat/a si recompensat/a pentru munca mea, chiar daca imi este dificil sa tolerez acest lucru. \"}','choice'),(68,4,'{\"ro\":\"Imi doresc mult sa fiu apreciat/a si recompensat/a pentru eforturile depuse in munca mea, dar asta nu inseamna ca trebuie cu necesitate sa fiu. \",\"en\":\"Imi doresc mult sa fiu apreciat/a si recompensat/a pentru eforturile depuse in munca mea, dar asta nu inseamna ca trebuie cu necesitate sa fiu. \"}','choice'),(69,4,'{\"ro\":\"Este neplacut si regretabil sa nu fii apreciat/a pentru munca ta, dar nu este groaznic.\",\"en\":\"Este neplacut si regretabil sa nu fii apreciat/a pentru munca ta, dar nu este groaznic.\"}','choice'),(70,4,'{\"ro\":\"Atunci cand ceilalti nu ma apreciaza si nu imi recunoasc meritele, ma gandesc ca sunt incompetenti sau nu sunt buni de nimic. \",\"en\":\"Atunci cand ceilalti nu ma apreciaza si nu imi recunoasc meritele, ma gandesc ca sunt incompetenti sau nu sunt buni de nimic. \"}','choice'),(71,4,'{\"ro\":\"Atunci cand nu sunt apreciat si recompensat corespunzator pentru munca mea, ma pot accepta ca fiind valoros si competent in ciuda acestui lucru. \",\"en\":\"Atunci cand nu sunt apreciat si recompensat corespunzator pentru munca mea, ma pot accepta ca fiind valoros si competent in ciuda acestui lucru. \"}','choice'),(72,5,'{\"ro\":\"Trebuie neaparat sa am realizari in sfera profesionala si sa lucrez cu persoane competente, de la care sa pot invata, la serviciu. \",\"en\":\"Trebuie neaparat sa am realizari in sfera profesionala si sa lucrez cu persoane competente, de la care sa pot invata, la serviciu. \"}','choice'),(73,5,'{\"ro\":\"Imi doresc foarte mult sa sa am realizari profesionale si sa lucrez cu persoane competente si motivate in echipa, dar asta nu inseamna ca trebuie neparat sa se intample acest lucru. \",\"en\":\"Imi doresc foarte mult sa sa am realizari profesionale si sa lucrez cu persoane competente si motivate in echipa, dar asta nu inseamna ca trebuie neparat sa se intample acest lucru. \"}','choice'),(74,5,'{\"ro\":\"Este groaznic daca nu am realizari in sfera profesionala si nu am sansa sa lucrez cu persoane competente la serviciu. \",\"en\":\"Este groaznic daca nu am realizari in sfera profesionala si nu am sansa sa lucrez cu persoane competente la serviciu. \"}','choice'),(75,5,'{\"ro\":\"Daca persoanele cu care lucrez la serviciu nu sunt pregatite foarte bine profesional, inseamna ca sunt incompetente si fara valoare. \",\"en\":\"Daca persoanele cu care lucrez la serviciu nu sunt pregatite foarte bine profesional, inseamna ca sunt incompetente si fara valoare. \"}','choice'),(76,5,'{\"ro\":\"Este de nesuportat si nu pot tolera daca nu am realizarile asteptate in sfera profesionala si sa lucrez cu persoane mai nemotivate sau nepregatite la serviciu. \",\"en\":\"Este de nesuportat si nu pot tolera daca nu am realizarile asteptate in sfera profesionala si sa lucrez cu persoane mai nemotivate sau nepregatite la serviciu. \"}','choice'),(77,5,'{\"ro\":\"Pot tolera chiar daca nu apar realizarile asteptate in sfera profesionala sau lucrez cu persoane mai putin motivate si competente decat mi-ar placea in echipa, desi imi este greu sa tolerez acest lucru.  \",\"en\":\"Pot tolera chiar daca nu apar realizarile asteptate in sfera profesionala sau lucrez cu persoane mai putin motivate si competente decat mi-ar placea in echipa, desi imi este greu sa tolerez acest lucru.  \"}','choice'),(78,5,'{\"ro\":\"Imi doresc foarte mult sa sa am realizari in sfera profesionala si sa lucrez cu persoane competente si motivate in echipa, dar realizez si accept ca 